<html lang="en-US"><head><title>IDGEN</title><link rel="stylesheet" href="https://dreams.kee7702.tk/assets/css/style.css"><meta name="viewport" content="width=device-width,initial-scale=1,maximum-scale=12,minimum-scale=.25,user-scalable=yes"></head><body><div class="wrapper" style="width: auto;padding: 1px 10px 10px 10px;background:transparent"><div style="margin-bottom:16px;padding: 0;background: transparent;" class="filedownload-container"><p class="dreamsdb infostats" style="display: block;line-height: 16px;margin: 0;">Check Console for output</p></div></div><section><link rel="stylesheet" href="https://dreams.kee7702.tk/assets/css/db-global.css"><script>logstyle='background:#333;color:#ccc;font-family:system-ui;padding:8px;border-radius:4px;margin:4px;border-color:#444;border-width:2px;border-style:solid';if(new URLSearchParams(window.location.search).get('d')){time=parseInt(new URLSearchParams(window.location.search).get('d'),36)}else{time=new Date().valueOf()}console.log('%cDiagnostic Page ID: '+time.toString(36),logstyle);if(new URLSearchParams(window.location.search).get('c')){console.log('%cCreator Video ID: '+(time+parseInt(new URLSearchParams(window.location.search).get('c'),36)).toString(36),logstyle)}else{console.log('%cNo Creator Provided',logstyle)}</script></section></body></html>
